// Process ConnectSafely.ai API response
// Response: [{ success: true, people: [...], pagination: {...}, hasMore: bool }]

const items = $input.all();
const results = [];

for (const item of items) {
  const response = item.json;

  // Handle array wrapper - API returns array with single object
  const data = Array.isArray(response) ? response[0] : response;

  if (!data || !data.success) {
    continue;
  }

  // Get the people array from response
  const people = data.people || [];

  for (const person of people) {
    // Extract company from headline if present (e.g., "CEO at Company Name")
    let company = '';
    const headline = person.headline || person.currentPosition || '';
    const atMatch = headline.match(/(?:at|@|-)\s*([^|‚Ä¢]+?)(?:\s*\||\s*‚Ä¢|$)/i);
    if (atMatch) {
      company = atMatch[1].trim();
    }

    results.push({
      json: {
        // Profile URL and IDs
        profileUrl: person.profileUrl || '',
        profileId: person.profileId || '',
        profileUrn: person.profileUrn || '',

        // Name
        fullName: `${person.firstName || ''} ${person.lastName || ''}`.trim(),
        firstName: person.firstName || '',
        lastName: person.lastName || '',

        // Professional info
        headline: person.headline || '',
        currentPosition: person.currentPosition || '',
        company: company,

        // Location
        location: person.location || '',

        // Network
        connectionDegree: person.connectionDegree || '',

        // Status flags
        isPremium: person.isPremium || false,
        isOpenToWork: person.isOpenToWork || false,

        // Profile picture
        profilePicture: person.profilePicture || '',

        // Timestamp
        extractedAt: new Date().toISOString()
      }
    });
  }
}

if (results.length === 0) {
  return [{ json: { error: 'No results found', timestamp: new Date().toISOString() } }];
}

return results;
